"""Test all implemented factory equivalents."""
for ftype, data in FACTORIES.items():
    with open(f'{TMPDIR}/{ftype}.{ftype}', mode='w') as output:
        output.write(data)
assert Namespace(TEST_DICT) == Namespace.from_toml(StringIO(TEST_TOML)
    ) == Namespace.from_toml(f'{TMPDIR}/toml.toml') == Namespace.from_yaml(
    StringIO(TEST_YAML)) == Namespace.from_yaml(f'{TMPDIR}/yaml.yaml'
    ) == Namespace.from_json(StringIO(TEST_JSON)) == Namespace.from_json(
    f'{TMPDIR}/json.json')
